const ENDPOINT = {
  GRID: "/api/grid",
  LIST: "/api/list",
};

const ERROR_MESSAGE = {
  GRID_GET: "Request to get grid text failed:",
  LIST_DELETE: "Request to delete list item failed:",
  LIST_ADD: "Request to add list item failed:",
  LIST_GET: "Request to get list items failed:",
  LIST_EMPTY_MESSAGE: "Please enter a valid message",
};

export {ENDPOINT, ERROR_MESSAGE};
